    let handleObject = feature=>typeof(feature)=='object' ? JSON.stringify(feature) : feature;
    let fields = ["state", "SuitabilityIndex", "EnvQuality_norm", "perm_norm", "total_sales_$1000_norm", "program_norm", "OpenCoast_norm", "port_norm"];
    let aliases = ["State:", "Suitability Index:", "Environmental Quality:", "Regulatory Score:", "Product Value:", "Program Density:", "Open Coast Area:", "Port Accessibility:"];
    let table = '<table>' +
        String(
        fields.map(
        (v,i)=>
        `<tr>
            <th>${aliases[i].toLocaleString()}</th>
            
            <td>${handleObject(layer.feature.properties[v]).toLocaleString()}</td>
        </tr>`).join(''))
    +'</table>';
    div.innerHTML=table;
    
    return div
    }
